import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <strong>
        <h4>Contact</h4><br />
        <h2>02-1234-5678</h2>
        <h2>이메일 : help@mindbridge.ai</h2> <br /><br /><hr className="small-line" /><br />
        <h3>(주) 화재감지기</h3><br />
        <h5>주소 : 서울특별시 종로구 종로12길 15 코아빌딩 5층</h5><br />
      </strong>
    </footer>
  );
};

export default Footer;
